DROP TABLE IF EXISTS amazon_products;
CREATE TABLE amazon_products (
  asin VARCHAR(20) PRIMARY KEY,
  delivery TEXT,
  discount VARCHAR(50),
  image_url TEXT,
  original_price DECIMAL(10,2),
  price DECIMAL(10,2),
  rating DECIMAL(3,2),
  sponsored BOOLEAN,
  title TEXT,
  url TEXT,
  category TEXT
);

